@import "tailwindcss";

@theme {
  --font-montserrat: 'Montserrat', sans-serif;
  --color-brand-blue: #2148C0;
}

@layer base {
  @import url('https://fonts.googleapis.com/css2?family=Montserrat:wght@300;400;500;600&display=swap');

  body {
    font-family: var(--font-montserrat);
    @apply antialiased;
  }
}

import React from 'react';

interface ButtonProps extends React.ButtonHTMLAttributes<HTMLButtonElement> {
  isLoading?: boolean;
}

export const Button: React.FC<ButtonProps> = ({ 
  children, 
  isLoading, 
  className = '', 
  ...props 
}) => {
  return (
    <button
      className={`
        w-full h-[53px] bg-brand-blue text-white rounded-[4px]
        font-semibold text-base uppercase tracking-normal
        shadow-[0px_4px_4px_rgba(0,0,0,0.3)]
        hover:bg-opacity-90 transition-all duration-200
        disabled:opacity-50 disabled:cursor-not-allowed
        flex items-center justify-center
        cursor-pointer
        ${className}
      `}
      disabled={isLoading || props.disabled}
      {...props}
    >
      {isLoading ? (
        <span className="w-5 h-5 border-2 border-white border-t-transparent rounded-full animate-spin" />
      ) : (
        children
      )}
    </button>
  );
};

import React from 'react';

interface InputProps extends React.InputHTMLAttributes<HTMLInputElement> {
  icon?: string;
  error?: string;
}

export const Input: React.FC<InputProps> = ({ 
  icon, 
  error, 
  className = '', 
  ...props 
}) => {
  return (
    <div className="w-full relative group">
      <div className="relative flex items-center">
        {icon && (
          <div className="absolute left-3 z-10 flex items-center justify-center w-5 h-5 pointer-events-none">
            <img src={icon} alt="" className="w-full h-full object-contain" />
          </div>
        )}
        <input
          className={`
            w-full h-[45px] bg-transparent
            border border-white rounded-[4px]
            text-white font-light text-sm uppercase placeholder-white
            focus:outline-none focus:ring-1 focus:ring-white/50
            transition-all duration-200
            ${icon ? 'pl-12 pr-4' : 'px-4'}
            ${error ? 'border-red-400' : 'border-white'}
            ${className}
          `}
          {...props}
        />
      </div>
      {error && (
        <span className="text-red-300 text-xs mt-1 absolute -bottom-5 left-0">
          {error}
        </span>
      )}
    </div>
  );
};

import React, { useState } from 'react';
import { Button } from '../components/ui/Button';
import { Input } from '../components/ui/Input';

export default function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setIsSubmitting(true);
    // Simulate API call
    await new Promise(resolve => setTimeout(resolve, 1500));
    setIsSubmitting(false);
    console.log('Login:', { username, password });
  };

  return (
    <div className="min-h-screen w-full bg-brand-blue relative overflow-hidden flex items-center justify-center">
      {/* Background Image */}
      <img 
        src="./assets/images/background.png" 
        alt="" 
        className="absolute inset-0 w-full h-full object-cover z-0 pointer-events-none"
      />

      {/* Content Container */}
      <div className="relative z-10 w-[300px] flex flex-col items-center">
         {/* Logo */}
         <div className="mb-[71px]">
            <img 
              src="./assets/logo.svg" 
              alt="Logo" 
              className="w-[120px] h-auto" 
            />
         </div>

         {/* Login Form */}
         <form className="w-full flex flex-col gap-5" onSubmit={handleSubmit}>
            <Input 
               placeholder="USERNAME" 
               icon="./assets/icons/user.svg" 
               value={username}
               onChange={(e) => setUsername(e.target.value)}
               required
            />
            <Input 
               type="password"
               placeholder="PASSWORD" 
               icon="./assets/icons/lock.svg" 
               value={password}
               onChange={(e) => setPassword(e.target.value)}
               required
            />

            <Button type="submit" className="mt-[43px]" isLoading={isSubmitting}>
               LOGIN
            </Button>
         </form>

         <a 
           href="#" 
           className="mt-[11px] text-white font-medium text-base hover:underline transition-all"
           onClick={(e) => e.preventDefault()}
         >
            Forgot password?
         </a>
      </div>
    </div>
  );
}

import React, { Suspense } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Lazy load pages
const Login = React.lazy(() => import('./pages/Login'));

function App() {
  return (
    <Router>
      <Suspense fallback={
        <div className="min-h-screen w-full bg-brand-blue flex items-center justify-center">
          <div className="w-8 h-8 border-4 border-white border-t-transparent rounded-full animate-spin"></div>
        </div>
      }>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="*" element={<Login />} />
        </Routes>
      </Suspense>
    </Router>
  );
}

export default App;

